7寸 背膜,iphone6s 前膜,iphone6s 背膜\r\n			</td>\r\n			<td>\r\n				尺寸\r\n			</td>\r\n			<td>\r\n				0.26mm弧边裸膜\r\n			</td>\r\n			<td>\r\n				<br />\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<div>\r\n	<a href=\"http://detail.1688.com/offer/521687868840.html?spm=a262l.22849.1998409647.3.YKWQWW#\"><i><em></em><span></span></i></a> \r\n</div>\r\n<div>\r\n	<div>\r\n	</div>\r\n</div>\r\n<p>\r\n	<strong>全宇宙价格最低的钢化膜厂家！质量第一，只为寻求长期合作！包您满意的钢化膜，只为更好的合作！</strong>\r\n</p>\r\n<p>\r\n	最安全最防刮的手机膜<br />\r\n1、更防刮：9H硬度，大大高于普通膜3H硬度，超强耐刮，正常使屏幕可3年不会刮花；<br />\r\n2、更清晰：光学级透光率，超低反射，超清高透；<br />\r\n3、防指纹：表面高分子防指纹处理，指纹抑制较普通保护膜大大提高（注：目前技术条件下，100%防指纹是不可能的，钢化玻璃高清膜可以最大限度提高防指纹效果）；<br />\r\n4、防爆裂：含有特殊胶体，与高档汽车玻璃一样，即使玻璃破裂仍然会保持块状，不用怕玻璃裂开后伤害到屏幕；<br />\r\n5、触摸顺滑：消除普通膜触摸生涩感，手感更加顺滑，触摸更加流利；<br />\r\n6、反应灵敏：虽然厚度为普通膜的3倍，但是使用时的触摸反应速度却更加出色<br />\r\n7、弧边设计：采用2.5D弧边设计，手握时手感更舒适，不伤手；<br />\r\n8、简单易贴：傻瓜式贴法，只要对准孔位，贴下就能自动吸附并排空里面的空气。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>','upload/20151031/d1c81145-b3b7-4dae-af7b-713a3f4f52f4.jpg','苹果6s钢化玻璃前膜 iphone6s钢化玻璃前膜 iPhone6钢化膜手机膜贴前膜',5,80,8,1000),(6,'2015-11-02 10:13:18','\0',0,'<p>\r\n	<span style=\"color:#E53333;font-size:24px;\">我要赚钱，我要成为分销级会员。</span>\r\n</p>\r\n<p>\r\n	本平台开通全民挣钱模式，通过简单介绍、推荐、组织人际网络实现不干活也能挣钱，所有想挣钱的朋友根据自己的时间，可全职、兼职的实现自己零浪费人生。而不需要使用高昂的成本，只要购买当前<span></span><span style=\"font-size:24px;color:#E53333;\">1元</span><span></span>产品即可成为分销级会员，1元是对自己的认可、对系统的信任、对未来的展望。\r\n</p>\r\n<p>\r\n	<span style=\"font-size:16px;color:#337FE5;\"><strong>分销级别：</strong></span>一级分销会员、二级分销会员、三级分销会员\r\n</p>\r\n<p>\r\n	<span style=\"color:#337FE5;font-size:16px;\"><strong>佣金制度：</strong></span>一级(20%佣金)、二级(10%佣金)<span>、三级(5%佣金)</span>\r\n</p>\r\n<p>\r\n	<span style=\"color:#337FE5;font-size:16px;\"><strong>赚钱方案：</strong></span><span style=\"font-size:12.0pt;font-family:宋体;\"><span style=\"font-family:Microsoft YaHei;font-size:12px;\">如您是</span><span style=\"font-family:Microsoft YaHei;font-size:12px;\">A</span><span style=\"font-family:Microsoft YaHei;font-size:12px;\">推荐了</span><span style=\"font-family:Microsoft YaHei;font-size:12px;\">B</span><span style=\"font-family:Microsoft YaHei;font-size:12px;\">，</span><span style=\"font-family:Microsoft YaHei;font-size:12px;\">B</span><span style=\"font-family:Microsoft YaHei;font-size:12px;\">推荐</span><span style=\"font-family:Microsoft YaHei;font-size:12px;\">C</span><span style=\"font-family:Microsoft YaHei;font-size:12px;\">进入系统，</span><span style=\"font-family:Microsoft YaHei;font-size:12px;\">C</span><span style=\"font-family:Microsoft YaHei;font-size:12px;\">销售掉一台价值200元的</span><span style=\"font-family:Microsoft YaHei;font-size:12px;\">POS</span><span style=\"font-family:Microsoft YaHei;font-size:12px;\">机，那么</span><span style=\"font-family:Microsoft YaHei;font-size:12px;\">C</span><span style=\"font-family:Microsoft YaHei;font-size:12px;\">获取</span><span style=\"font-family:Microsoft YaHei;font-size:12px;\">20%</span><span style=\"font-family:Microsoft YaHei;font-size:12px;\">奖励，</span><span style=\"font-family:Microsoft YaHei;font-size:12px;\">B</span><span style=\"font-family:Microsoft YaHei;font-size:12px;\">获取</span><span style=\"font-family:Microsoft YaHei;font-size:12px;\">10%</span><span style=\"font-family:Microsoft YaHei;font-size:12px;\">奖励，</span><span style=\"font-family:Microsoft YaHei;font-size:12px;\">A</span><span style=\"font-family:Microsoft YaHei;font-size:12px;\">就是你获取</span><span style=\"font-family:Microsoft YaHei;font-size:12px;\">5%</span><span style=\"font-family:Microsoft YaHei;font-size:12px;\">奖励，那么如果您推荐</span><span style=\"font-family:Microsoft YaHei;font-size:12px;\">30</span><span style=\"font-family:Microsoft YaHei;font-size:12px;\">个有能力的人，然后30位二级分销级会员又分别推荐30位到自己名下成为自己的分销级会员，那么您拥有30 x 30 = 900人，每人每天都销售掉如POS机似的商品，那么您将获取利润是：30 x 30 x 200 x 5% = 9000(元)，当然您不仅仅只有30位二级分销会员，<span style=\"font-size:12.0pt;font-family:宋体;\"><span style=\"font-family:Microsoft YaHei;font-size:12px;\">您的潜能是巨大的，你懂得...</span></span><span></span></span><span></span></span>\r\n</p>','upload/20151102/1fa7ac89-c560-447e-8da3-d3caf3fbe344.jpg','我要赚钱，我要成为分销级会员',8,98,1,1000);

